Music Routes
--------------------------------------------------------------------------------


The episode features cover versions of &quot;Don't Rain on My Parade&quot; by Barbra Streisand, &quot;You Can't Always Get What You Want&quot; by The Rolling Stones, &quot;My Life Would Suck Without You&quot; by Kelly Clarkson, &quot;And I Am Telling You I'm Not Going&quot; from Dreamgirls, &quot;Don't Stop Believin'&quot; by Journey and &quot;Proud Mary&quot; by Creedence Clearwater Revival. Studio recordings of &quot;And I Am Telling You I'm Not Going&quot;, &quot;Don't Rain On My Parade&quot;, &quot;You Can't Always Get What You Want&quot; and &quot;My Life Would Suck Without You&quot; were released as singles in December 2009, available for digital download. They also feature on the album Glee: The Music, Volume 2. Jenna Ushkowitz named &quot;You Can't Always Get What You Want&quot; one of her favorite songs on the album, deeming the original &quot;a classic&quot; and the Glee cover &quot;emotional&quot; as one of the final songs of the original run of episodes. The performance of &quot;My Life Would Suck Without You&quot; showcased choreography from numerous performances from earlier episodes.
